import React from 'react'
import { Parallax, Background } from 'react-parallax';
import { ContactParallax } from './components/ParallaxComponents';
import styled from 'styled-components';

const background = styled.div`
    height: 100%;
    width: 100%;
`;

const image1 =
  "https://images.unsplash.com/photo-1498092651296-641e88c3b057?auto=format&fit=crop&w=1778&q=60&ixid=dW5zcGxhc2guY29tOzs7Ozs%3D";

const image2 =
    "https://images.pexels.com/photos/1191710/pexels-photo-1191710.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940";

export const Contact = () => (
    <div>
        <Parallax
            bgImage={image1} strength={500}
        >
            <div style={{ height: 500, width: window.innerWidth}}>
                <div>HTML INSIDE</div>
            </div>
        </Parallax>

        <div style={{ height: 500}}/>

        <Parallax
            bgImage={image1} strength={500}
        >
            <div style={{ height: 500}}>
                <div>HTML INSIDE</div>
            </div>
        </Parallax>

        <div style={{ height: 500}}/>

        <Parallax
            bgImage={image1} strength={500}
        >
            <div style={{ height: 500}}>
                <div>HTML INSIDE</div>
            </div>
        </Parallax>

        <div style={{ height: 500}}/>

        <Parallax
            bgImage={image1} strength={500}
        >
            <div style={{ height: 500}}>
                <div>

                <Parallax
                    bgImage={image2} strength={500}
                >
                    <div style={{ height: 100, width: 200}}>
                        <div>HTML INSIDE</div>
                    </div>
                </Parallax>

                </div>
            </div>
        </Parallax>
    </div>
)
